import React from "react";
import macbook from "./macbook.png"

const Main = () => {
    return (
        <div className="w-full h-screen bg-[#f8f7f3]">
            <div className="w-full h-2/3 flex justify-center items-center">
            <img src={macbook} className="w-4/5">
                <div>
                    <h1>Erdenay</h1>
                </div>
            </img>
            </div>
        </div>
    )
}

export default Main
